import { NavLink } from "react-router-dom";

interface navBarProps {
    isOnEditor: boolean
}

const NavBar = (props: navBarProps) => {

    return  (
        <nav>
            {/* the button */}
            {props.isOnEditor? (
                <ul>
                    <li>
                        <NavLink to="/"> Back To Projects </NavLink>
                    </li>
                </ul>
            ) : (
                <ul>
                    <li>
                        <NavLink to="/"> Projects </NavLink>
                    </li>
                    <li>
                        <NavLink to="/recently-deleted"> Recently Deleted</NavLink>
                    </li>
                </ul>
            )}

        </nav>
    );  
};

export default NavBar
